Since Atomic Schema requires the presence of a key slug in Properties, converting Atomic Data to JSON results in dev-friendly objects with nice shorthands. ["https://example.com/john","https://example.com/properties/lastname","Houdini"]
["https://example.com/john","https://example.com/properties/bestFriend","https://example.com/sarah"] Can be automatically converted to: { "@context": { "name": "https://example.com/properties/lastname", "bestFriend": "https://example.com/properties/bestFriend", }, "name": "John", "bestFriend": { "@id": "https://example.com/sarah" },
} The @context object provides a mapping to the original URLs. The @id key shows that the value should be interpreted as a link (a URI).

