A JS compatible library, accessible as an NPM package is the most popular and developer friendly way to start. Here's some pseudocode that indicates how it might be used: import {createStore} from '@atomicdata'; const config = { // A URL to a TPF compatible endpoint where the data can be fetched tpfEndpoint: "https://example.com/tpf", // A UTL to an Atomic Mutations endpoint where the client can subscribe to changes mutationsEndpoint: "https://example.com/mutations", // A UTL to an Atomic Suggestions endpoint where the client can send suggested state changes sugestionsEndpoint: "https://example.com/suggestions",
}; const store = createStore(config); // Initializes the store // The `classInitializer` function takes an Atomic Class URI as its argument
// fetches the Class, its Properties and the DataTypes
// and returns a function that let's you create instances of that class
const personBuilder = await store.classInitializer("https://example.com/classes/Person"); // Create an instance of the Person Class
// An Atomic Suggestion is sent to the
const alice = await personBuilder({ // The Subject field is optional, but recommended if you want to control its URL. // Otherwise, the Server will pick something subject: "https://example.com/alice", // The IDE is aware of the existing keys and their acceptable values, // because a conversion from Atomic Classes and Properties // to typescript interfaces can be made automatically firstName: "Alice", lastName: "Anderson", bestFriend: "https://example.com/Bob", birthDate: new Date("1991-01-20"), // Since the URL in the key below can be fetched, and has a Property + Datatype, the IDE + the compiler can determine that 'true' is an acceptable type. "https://example.com/someOtherProperty": true,
}) console.log(person.subject) //=> Should return a newly created identifier, https://example.com/alice // Checks the store for the subject, and returns it.
// If the subject does not exists locally, it will fetch it first using the `tpfEndpoint`.
const alice = await store.get("https://example.com/alice") // Because of the keys in Atomic Properties, we can use this dot syntax to traverse the graph and get a value
console.log(await alice.path("bestFriend.firstName")).value(); // => "Bob"
// What should happen here?
console.log(await alice.bestFriend); // => {...} // It's also possible to convert a resource to a native JS object.
// By specifying the depth, nested resources will be fetched as well.
const aliceJS = await store.get("https://example.com/alice").toJS(depth: 2) console.log(aliceJS.bestFriend) // => { name: Bob, birthdate: Date(1991-01-20)} I think a Developer Experience similar to the one above is essential for getting people to create linked data. It should be incredibly easy, and this is what enables that. However, realizing a library + IDE support as shown above is hard at the least, perhaps even impossible. Theoretically, the information is accessible - but I'm not sure whether the IDE and the JS context (e.g. the Typescript compiler) can successfully see which shape is being returned by the classInitializer function.

