AD3 stands for Atomic Data Triples , and it's the simplest and fastest way to serialize / parse Atomic Data. AD3 represents a single Atom as a single line, containing a JSON array of three strings, respectively representing the Subject, Property and Value. It looks like this: ["https://example.com/subject","https://example.com/property","some object"]
["https://example.com/subject","https://example.com/otherProperty","https://example.com/somethingelse"] It uses Newline Delimited JSON ( NDJSON ) for serialization, which is just a large string with newlines between each JSON object. NDJSON has some important benefits: Streaming parsing : An NDJSON document can be parsed before it's fully loaded / transmitted. That is not possible with regular JSON. High compatibility : NDJSON parsers can use JSON parsers, and are therefore everywhere. Performance : Modern browsers have highly performant JSON parsing, which means that it's fast in one of the most important contexts: the browser. Mime type (not registered yet!): application/ad3-ndjson File name extension: .ad3 Disclaimer: note that AD3 is useful for communicating current state , but not for state changes . You can validate AD3 at atomicdata.dev/validate . Atomic Triples is heavily inspired by HexTuples-NDJSON . Example serialization implementation written in Rust, to show you how easy it is to serialize this! pub fn serialize_atoms_to_ad3(atoms: Vec<Atom>) -> AtomicResult<String> { let mut string = String::new(); for atom in atoms { // Use an exsting JSON serialization library to take care of the hard work (escaping quotes, etc.) let mut ad3_atom = serde_json::to_string(&vec![&atom.subject, &atom.property, &atom.value])?; ad3_atom.push_str("\n"); &string.push_str(&*ad3_atom); } return Ok(string);
} And an example parser: pub fn parse_ad3<'a, 'b>(string: &'b String) -> AtomicResult<Vec<Atom>> { let mut atoms: Vec<Atom> = Vec::new(); for line in string.lines() { match line.chars().next() { // These are comments Some('#') => {} Some(' ') => {} // That's an array, let's do this! Some('[') => { let string_vec: Vec<String> = parse_json_array(line).expect(&*format!("Parsing error in {:?}", line)); if string_vec.len() != 3 { return Err(format!( "Wrong length of array at line {:?}: wrong length of array, should be 3", line ) .into()); } let subject = &string_vec[0]; let property = &string_vec[1]; let value = &string_vec[2]; atoms.push(Atom::new(subject, property, value)); } Some(char) => { return Err(format!( "AD3 Parsing error at {:?}, cannot start with {}", line, char ) .into()) } None => {} }; } return Ok(atoms);
}

