http://jsonpatch.com/ A simple way to edit JSON objects: The original document { "baz": "qux", "foo": "bar"
} The patch [ { "op": "replace", "path": "/baz", "value": "boo" }, { "op": "add", "path": "/hello", "value": ["world"] }, { "op": "remove", "path": "/foo" }
] The result { "baz": "boo", "hello": ["world"]
} It uses the JSON-Pointer spec for denoting paths. It has quite a bunch of implementations, in various languages.

